import './App.css';
import Checkout from './Checkout';
import Header from './Header';
import Home from './Home';
import {BrowserRouter as Router,Route,Routes} from 'react-router-dom'
import { Container } from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <>
      <Router>
        <Routes>

          <Route path='/checkout'>
          <Header/>
          <Checkout/>
          </Route>

          <Route path='/'>
          <Header/>
          <Home/>
          </Route>

        </Routes>
      </Router>
      </>


    </div>
  );
}

export default App;
